import './App.css';


export default class App extends React.Component { 

  sanoHeippa = () : void => {

    alert("Heippa!");


  }
  render() {
  return (
    <div className="container">
      <h1>Demo 1: Hello World!</h1>

      <button className="btn btn-primary" onClick={this.sanoHeippa}>Sano heippa!</button>
    </div>
  )
}
}
